import React, { useState, useEffect } from 'react';
import { Link, useParams } from "react-router-dom";
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import axios from 'axios';
import { Button } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
const DeleteProducts= (props) => {
    const { id } = useParams();
    const [usr, setUsr] = useState();




    useEffect(() => {
        axios.get(`https://fakestoreapi.com/products/${id}`).then(result => {
            setUsr(result.data);
        })
    }, [id]);

    const handleRemovePost = () => {
        axios.delete(`https://fakestoreapi.com/products/${id}`).then(result => {
            props.history.push("/products");
        })
    }


    const handleCancelPost = () => {
          props.history.push("/products");

    }


    return (




 <Paper sx={{ p: 2, margin: 'auto', maxWidth: 1000, flexGrow: 1 }}>
          <Typography variant="h2" component="h1" gutterBottom>


      </Typography>

      <Grid container spacing={2}>

        <Grid item xs={12} sm container>
          <Grid item xs container direction="column" spacing={2}>
            <Grid item xs>
              <Typography gutterBottom variant="subtitle1" component="div">


              </Typography>


              <Typography gutterBottom variant="subtitle1" component="div">
              {/* {usr?.email} */}

              </Typography>


              <Typography gutterBottom variant="subtitle1" component="div">


              </Typography>

              <Typography gutterBottom variant="subtitle1" component="div">
              <Button  style={{float:'center' ,marginLeft:'50px'}}   onClick={handleCancelPost} className="btn btn-outline-danger">

           <ArrowBackIcon/>


              </Button>

              <Button variant="outlined"  onClick={handleRemovePost}  startIcon={<DeleteIcon />}>
  Delete
</Button>
                <Button  style={{float:'center'}} variant="outlined" color="error">
                <DeleteIcon /> Supprimer 
                </Button>
              </Typography>
            </Grid>

          </Grid>

        </Grid>
      </Grid>
    </Paper>
    );
}

export default DeleteProducts;
